[[File:Bake Pie icon (mobile).png|left]]
The [[Lunar spell]] '''Bake Pie''' cooks uncooked [[pies]] in the player's inventory automatically, one by one, without the risk of burning them. The player must still have the [[Cooking]] level required for the spell to work on the pie ([[boost]]s may be used). The usual Cooking [[experience]] is granted for each pie baked with this spell.

Once cast, Bake Pie will automatically cook each pie in the inventory. However, one set of [[runes]] is required for '''each''' pie.

This spell works for completing the elite Varrock diary task for baking a summer pie.

''As with all [[Lunar spells]], the [[Lunar Diplomacy]] [[quest]] must be completed to cast this spell.''

